import React from 'react';
import logo from '../logo.svg';

class Body extends React.Component{

    constructor(props){
        super(props);

        this.user = this.props.userDetails;
        this.add = this.props.userDetails.address;

        this.state = {
            "name" : "pavan",
            lastName : "jindam",     
            user : {
                email : "pavan@yopmail.com"
            }     
        }


         // This binding is necessary to make `this` work in the callback
        this.handleEvent = this.handleEvent.bind(this);
    }

    // we can't change set but we can re-initiate and reassign it.
    handleEvent(){
        this.setState(state => ({
            "name" : "Santosh",
            "lastName" : "jala"
        }));
    }

    
    
    
    render(){
        
        return(
            <div>
                <img src={logo} className="App-logo" alt="logo" /> <br/>
                <button onClick={this.handleEvent}>Change Name</button>
                <ul>
                    <li> <b> First Name: </b> {this.state.name}  </li>
                    <li> <b> State Last Name: </b> {this.state.lastName}  </li>

                    <li> <b> Last Name: </b> {this.user.lastName}  </li>
                    <li> <b> Location: </b> {this.user.location}  </li>

                    <li> <b> City: </b> {this.add.city}  </li>
                    <li> <b> Pincode: </b> {this.add.pincode}  </li>
            
                </ul>
                <button className="btn btn-primary">On</button>
            </div>
        );
    }
}


export default Body;
